import React from 'react'

export default function LiBareDefilement({text}) {
  if(text){
    return(
      <p className='text-sm text-center list-none text-vertFonce font-[Whyte]'>
           {text}
      </p>
    )
  }
  if(!text){
    return(
      
      <p className='bg-vertFonceDeux rounded-[50%] w-[7px] h-[7px] '>
          
      </p>
      
    )
  }
}
